    public static int findMaxConsecutiveOnes(int[] nums) {
        int maxSum = 0;
        int currentSum = 0;
        for (int i = 0; i < nums.length; i++) {
            if (nums[i] == 1) {
                currentSum++;
            } else {
                if (currentSum > maxSum) {
                    maxSum = currentSum;
                }
                currentSum = 0;
            }
        }

        if (currentSum > maxSum) {
            maxSum = currentSum;
        }
        return maxSum;
    }
